import './App.scss';
import './About'
import './Contact'
import './Main'

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Main from './Main';



class App extends React.Component {

  constructor(props) {
    this.state = {
      logoVisible: false
    }
  }

  makeLogoVisible() {
    this.setState({
      logoVisible: true
    })
  }

  makeLogoInvisible() {
    this.setState({
      logoVisible: false
    })
  }

  render() {

    return (

      <Router>
        <div className="top-bar">
          <div className="about">about</div>
          <h1>bethany wellik</h1>
          <div className="contact"> contact</div>
      </div>
        <Switch>
          <Route path="/about">
            <about />
          </Route>
          <Route path="/contact">
            <contact />
          </Route>
          <Route path="/">
            <Main></Main>
          </Route>
        </Switch>

      </Router>
    );
  }

}


export default App;
